import React, { Component } from "react";
import Slider from "react-slick";


export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div>
        <Slider {...settings}>
          <div className='slide1'>
              <div id="text-banner">
                  <h1>
                  MONA SNEker
                  </h1>
                  </div>
          </div>
          <div className='slide2'>
            <h3>2</h3>
          </div>
          <div className='slide3'>
            <h3>3</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
